import React from 'react'

export const gallery = () => {
    return (
      <section className="bg-white py-16 px-4">
        <div className="container mx-auto">
          <h2 className="text-3xl font-bold mb-8">Photo Gallery</h2>
          <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-4">
            <div className="relative">
              <img
                className="w-full h-full object-cover rounded-lg shadow-lg"
                src="https://via.placeholder.com/600x400"
                alt="Photo"
              />
              <div className="absolute top-0 left-0 w-full h-full bg-gray-800 bg-opacity-50 text-white flex items-center justify-center opacity-0 hover:opacity-100 transition-opacity">
                <button className="bg-white text-gray-800 font-bold py-2 px-4 rounded-full">View</button>
              </div>
            </div>
            {/* Repeat this code block for each photo */}
          </div>
        </div>
      </section>
    );
  };
